★★★バスマジックリン 泡立ちスプレー 壁の防カビプラス★★★<br>泡が汚れにはりついて効くから、浴槽などの湯垢や皮脂汚れもスッキリ落とせます。<br>水切れ成分配合。<br>壁の水切れをよくし、カビの原因となる水滴を残さないことでカビの発生を防ぎます。<br>※カビが生えている所は、カビハイターなどでカビを落としてからご使用ください。<br><br>【用途】<br>◎浴槽内の毎日のおそうじに・・・<br>◎浴室の床、壁、洗面器などに・・・<br>◎カビの防カビに・・・<br>◎除菌に・・・<br>※すべての菌を除菌するわけではありませんのでご注意ください。<br><br>【成分】<br>水、ブチルカルビトール、エチルアルコール、脂肪酸アミドプロピルベタイン、ポリオキシエチレンアルキルエーテル、アルキルエーテル硫酸エステル塩、エチレンジアミン四酢酸塩、塩化ベンザルコニウム、アルキルグリコシド、純石けん分(脂肪酸塩)、クエン酸塩、表面改質剤、香料<br><br>★★★マジックリン ピカッと輝くシート★★★<br>かきとりファイバーと研磨剤が汚れをしっかりかきとります！<br>・研磨力と洗浄力のダブルの効果で汚れを落とします<br>・柔軟性のあるシートが曲面や凹凸面にフィットして汚れを落とします<br>・力を入れても破れにくい丈夫なシートです<br>・使い捨てなので衛生的です<br><br>【用途】<br>水まわりで気になる手ごわい水垢汚れや普段落としきれない汚れの除去、お手入れに。<br>・浴室(蛇口、鏡、シャワーヘッドなど)<br>・洗面台(蛇口、鏡、洗面台ボウルなど)<br>・キッチン(蛇口、シンク、天板、ガスコンロ、IHクッキングヒーターの天面、調理器具など)<br><br>【材質】<br>ポリエステル、パルプ<br><br>【成分】<br>研磨剤、界面活性剤(ポリオキシエチレンアルキルエーテル)<br><br>【使用上の注意】<br>◎用途以外に使用しないでください。<br>◎子供の手の届くところに置かないでください。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：花王<br>シリーズ名：マジックリン<br>セット内容：詰替：330ml×2個、シート：試供品1枚<br>液性：バスマジックリン防カビプラス：中性、シート：弱アルカリ性<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><img src=http://image.rakuten.co.jp/onestep/cabinet/parts/gentei.jpg alt=数量限定><br><font color=#FF0000>※数量限定のため、先着順での販売となります。<br> ご注文のタイミングによっては、完売となっている場合がございます。<br> その際はキャンセル扱いとさせていただきますので、予めご了承下さい。</font><br><br><br>★★バスマジックリン 泡立ちスプレー 壁の防カビプラス★★<br>・一部の浴槽や床、壁では白く変色することがあるので目立たない所で確かめてからお使いください。<br>・認知症の方などの誤飲を防ぐため、置き場所に注意してください。<br>・目より高い所は、スポンジや布につけて洗ってください。<br>・換気をよくしてお使いください。<br>・大理石には使用しないでください。<br>※人工大理石には使えます。<br>・塗装面は目立たない場所で確かめてからお使いください。<br>・使用後は手をよく水で洗ってください。<br>・荒れ性の方や長時間使用する場合、炊事用手袋をお使いください。<br>・目に入った時は、こすらずすぐ流水で洗い流してください。<br>・飲み込んだ時は、吐かずに口をすすぎ、水を飲む等の処置をしてください。<br><br>★★マジックリン ピカッと輝くシート★★<br>・対象物の取扱説明書をご参照のうえご使用ください。<br>・使用後は手を水でよく洗ってください。<br>・荒れ性の方や長時間使用する場合は炊事用手袋を使ってください。<br>・顔や体には使用しないでください。<br>・ミシン目で切るときは液や粉が目に入らないように注意してください。<br>・人工大理石の調理台など、銅・アルミなどの柔らかい金属、プラスチック製品やテフロン、フッソ加工などの塗装面に使う時は目立たない場所で試してからご使用下さい。<br>・強くこすると傷がつくことがあります。<br>・鏡やガラスに硬いゴミや汚れの付着が多い場合は、あらかじめ除去してから使用してください。<br>・長期間放置して固まった汚れなどすべての汚れが落とせるものではありません。<br>・鏡の腐食による汚れは落とせないのでご注意ください。<br>・高温多湿な場所には保管しないでください。<br>・火のそばに近づけないでください。<br><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>FM9453 fm9453 4901301316844 花王 かおう カオー かおー カオウカブシキガイシャ 花王株式会社 かおうかぶしきがいしゃ KAO kao マジックリン まじっくりん バスマジックリン ばすまじっくりん バス用 お風呂用 風呂用 バス用洗剤 お風呂用洗剤 風呂用洗剤 洗剤 お風呂掃除 おふろそうじ 風呂掃除 ふろそうじ 掃除用洗剤 お風呂掃除用洗剤 風呂掃除用洗剤 泡立ちスプレー あわだちすぷれー 泡立ち あわだち すぷれー スプレー 時短 時間短縮 節水 マジック泡 まじっくあわ マジックあわ 詰め替え 詰替え 詰替 つめかえ 壁の防カビプラス 壁の防カビ かべのぼうかび 防カビ ピカッと輝くシート ぴかっとかがやくしーと シート しーと お掃除シート 掃除用シート ジャグチ 蛇口 じゃぐち 浴室 お風呂場 おふろば ふろば 風呂場 台所 キッチン 洗面台 洗面所 鏡 シンク ガスコンロ かきとりファイバー 手軽 簡単 クレンジング成分入り クレンジング くれんじんぐ 研磨剤 水あか 水垢 みずあか 水アカ</font></td></tr></table><style type="text/css">
